import React from 'react';
import "../App.css";

function Navigation() {
    return (
        <div className="Navigation">
            <div className="leftSide">
            <ul className="menu">
                    <li><link to="MainCourse" smooth={true} duration={2000}>Main Course</link></li>
                    <li><link to="ComboOffers"smooth={true} duration={2000}>Combo Offers</link></li>
                    <li><link to="Watermelon"smooth={true} duration={2000}>Watermelon</link></li>
                    <li><link to="Brownies"smooth={true} duration={2000}>Brownies</link></li>
                </ul>
  

            </div>
           
            
        </div>
    )
}

export default Navigation
